import React from 'react';
import Navbar from './components/Navbar';
import Profile from './components/Profile';
import Feed from './components/Feed';
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Profile />
      <Feed />
    </div>
  );
}

export default App;
